import React from "react";
import "./coffeeslider.css";

const CoffeeSlider = (props) => {
    const {
        step,
        min,
        max,
        value,
        onChangeValue,
    } = props;

    const handleChange = max => e =>{
        onChangeValue(e)
    }
    return (
      <>
        <div className="coffecup">
          Cups of Joe
          <input
            className="cupsofjoe"
            type="range"
            step={step}
            min={min}
            max={max}
            value={value}
            onChange={handleChange(max)}
          />
        </div>

      </>
    );
}
export default CoffeeSlider;
